public class InnerTableGlobalSecondaryIndexFactory(Action<Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex> factoryAction = null) : SubResourceFactory<Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex>
{

    internal InnerTableOnDemandThroughputFactory OnDemandThroughputFactory { get; set; }

    internal InnerTableContributorInsightsSpecificationFactory ContributorInsightsSpecificationFactory { get; set; }

    internal InnerTableProjectionFactory ProjectionFactory { get; set; }

    internal InnerTableProvisionedThroughputFactory ProvisionedThroughputFactory { get; set; }

    protected override Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex Create()
    {
        var globalSecondaryIndexResult = CreateGlobalSecondaryIndex();
        factoryAction?.Invoke(globalSecondaryIndexResult);

        return globalSecondaryIndexResult;
    }

    private Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex CreateGlobalSecondaryIndex()
    {
        var globalSecondaryIndexResult = new Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex();

        return globalSecondaryIndexResult;
    }
    public override void CreateChildren(Humidifier.DynamoDB.TableTypes.GlobalSecondaryIndex result)
    {
        base.CreateChildren(result);

        result.OnDemandThroughput ??= OnDemandThroughputFactory?.Build();
        result.ContributorInsightsSpecification ??= ContributorInsightsSpecificationFactory?.Build();
        result.Projection ??= ProjectionFactory?.Build();
        result.ProvisionedThroughput ??= ProvisionedThroughputFactory?.Build();
    }

} // End Of Class

